import React from 'react';
import SignIn from '../Containers/Login/SignIn';
import SignUp from '../Containers/Registration/SignUp';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PageErr from '../Containers/ErrPage/PageErr';
import Navigator from '../Containers/Navs/Navigate';
import About from '../Containers/About/About';
import Contact from '../Containers/Contact/Contact';
import NewIndex from '../Containers/new-dex/NewIndex';
import DashMain from '../Containers/Dashboard/DashMain';



export default function Main() {
       return (
              <div>
                     <Router>
                            <Routes>
                                   <Route element={<Navigator/>} />
                                   <Route path='/About' element={<About />} />
                                   <Route index path='/index'  element={<NewIndex />} />
                                   <Route path='/Contact' element={<Contact/>} />
                                   <Route path='/login' element={<SignIn />} />
                                   <Route path='/register' element={<SignUp />} />
                                   <Route path='/dashboard' element={<DashMain />} />
                                   {/* <Route path='/sample' element={<Sample />} /> */}
                                   <Route path='*' element={<PageErr />} />
                            </Routes>
                     </Router>
              </div>
       )
}
